import React, {Component} from 'react';

class Calculator extends Component {
  constructor() {
    super();
    this.state = {
      x: '',
      total: '',
    };
  }

  handleButtonClick = () => {};

  render() {
    return (
      <div>
        <div>Screen</div>
        <div style={rows}>
          <div style={buttonContainer}>7</div>
          <div>8</div>
          <div>9</div>
          <div>/</div>
        </div>
        <div style={rows}>
          <div>4</div>
          <div>5</div>
          <div>6</div>
          <div>X</div>
        </div>
        <div style={rows}>
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>-</div>
        </div>
        <div style={rows}>
          <div>0</div>
          <div>.</div>
          <div>+</div>
          <div>=</div>
        </div>
      </div>
    );
  }
}

const rows = {
  display: 'flex',
};

const buttonContainer = {
  border: '.5px solid green',
  padding: '3px',
};

export default Calculator;
